import "./App.css";

function App() {
  return (
    <div id="colorlib-page">
      <div class="container-wrap">여긴 뭘까</div>
      <a
        href="#"
        class="js-colorlib-nav-toggle colorlib-nav-toggle"
        data-toggle="collapse"
        data-target="#navbar"
        aria-expanded="false"
        aria-controls="navbar"
      >
        <i>여긴 또 뭘까요</i>
      </a>
    </div>
  );
}

export default App;
